import React from "react";
import "./Post.css";
import Avatar from "@material-ui/core/Avatar";
export default function Post() {
  return (
    <div className="post">
      <div className="post__header">
        <Avatar className="post__avatar" alt=" Anis " src="" />
        <h3>Username</h3>
      </div>
      <img
        className="post__image"
        src="https://images.theconversation.com/files/305837/original/file-20191209-90562-nsnsun.jpg?ixlib=rb-1.1.0&rect=284%2C696%2C1934%2C965&q=45&auto=format&w=1356&h=668&fit=crop"
        alt=""
      />
      <h4 className="post__text">
        <strong>Anis</strong> Wow awesome trees
      </h4>
    </div>
  );
}
